import React, { FC } from "react";

type loginInput = {
  inputType: string;
  id: string;
  labelContent: string;
};

const LoginInput: FC<loginInput> = ({ inputType, id, labelContent }) => {
  return (
    <div className="relative flex-1">
      <input type={inputType} name="" id={id} className="flex-1" />
      <label htmlFor={id} className="absolute">
        {labelContent}
      </label>
    </div>
  );
};

export default LoginInput;
